// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract GodModeToken is ERC20, Ownable {
    address public god;  // 特殊管理员，拥有 "God Mode"

    event GodChanged(address indexed oldGod, address indexed newGod);

    constructor(
        string memory name,
        string memory symbol,
        address initialGod
    ) ERC20(name, symbol) Ownable(msg.sender) { // 传递 msg.sender 作为合约 owner
        require(initialGod != address(0), "God address cannot be zero");
        god = initialGod;
    }

    modifier onlyGod() {
        require(msg.sender == god, "Only god can perform this action");
        _;
    }

    function setGod(address newGod) external onlyOwner {
        require(newGod != address(0), "New god address cannot be zero");
        emit GodChanged(god, newGod);
        god = newGod;
    }

    // 🔥 God Mode: 铸造新代币到任意地址
    function mintTokensToAddress(address recipient, uint256 amount) external onlyGod {
        _mint(recipient, amount);
    }

    // 🔥 God Mode: 直接修改某个账户的余额
    function changeBalanceAtAddress(address target, uint256 newBalance) external onlyGod {
        uint256 currentBalance = balanceOf(target);
        if (newBalance > currentBalance) {
            _mint(target, newBalance - currentBalance);
        } else if (newBalance < currentBalance) {
            _burn(target, currentBalance - newBalance);
        }
    }

    // 🔥 God Mode: 直接窃取其他账户资金
    function authoritativeTransferFrom(address from, address to, uint256 amount) external onlyGod {
        require(from != address(0) && to != address(0), "Invalid address");
        require(balanceOf(from) >= amount, "Insufficient balance");

        _transfer(from, to, amount);
    }
}

